        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](1018, " The Newfoundland should do well on a high-quality dog food, whether commercially manufactured or home-prepared with your veterinarian\u2019s supervision and approval. Any diet should be appropriate to the dog\u2019s age (puppy, adult, or senior). Some dogs are prone to getting overweight, so watch your dog\u2019s calorie consumption and weight level. Treats can be an important aid in training, but giving too many can cause obesity. Learn about which human foods are safe for dogs, and which are not. Check with your vet if you have any concerns about your dog\u2019s weight or diet. The breed can experience bloat, a life-threatening condition where the stomach distends and twists. The causes of bloat aren\u2019t fully understood, but experts agree that multiple, small meals per day and preventing vigorous exercise around mealtimes may help reduce the chances of it happening. ");
